using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class PipeModel : Notifier	{		public PipeModel()		{					NPS = "";			OD = "";			SCH5S_THK = "";			SCH5S_SO = "";			SCH10S_THK = "";			SCH10S_SO = "";		}				private string _NPS;		public string NPS			{				get { return _NPS; }				set				{					_NPS = value;					OnPropertyChanged(nameof(NPS));				}			}				private string _OD;		public string OD			{				get { return _OD; }				set				{					_OD = value;					OnPropertyChanged(nameof(OD));				}			}				private string _SCH5S_THK;		public string SCH5S_THK			{				get { return _SCH5S_THK; }				set				{					_SCH5S_THK = value;					OnPropertyChanged(nameof(SCH5S_THK));				}			}				private string _SCH5S_SO;		public string SCH5S_SO			{				get { return _SCH5S_SO; }				set				{					_SCH5S_SO = value;					OnPropertyChanged(nameof(SCH5S_SO));				}			}				private string _SCH10S_THK;		public string SCH10S_THK			{				get { return _SCH10S_THK; }				set				{					_SCH10S_THK = value;					OnPropertyChanged(nameof(SCH10S_THK));				}			}				private string _SCH10S_SO;		public string SCH10S_SO			{				get { return _SCH10S_SO; }				set				{					_SCH10S_SO = value;					OnPropertyChanged(nameof(SCH10S_SO));				}			}			}}